import logo from './logo.svg';
import './App.css';
import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';
import { Nav, NavItem, NavLink } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faVideo } from '@fortawesome/free-solid-svg-icons';
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import { faStar } from '@fortawesome/free-solid-svg-icons';
import {Movie} from '.'



function App() {
  var movieData = [  {like: true,
                      Vues: 7,
                      Avis: 3,
                      Moyenne: 6,
                      Nom: "BadBoy"},
                      { like: false,
                        Vues: 7,
                        Avis: 3,
                        Moyenne: 6,
                        Nom: "Jumanji"} ];

  var movieList = movieData.map((oneMovie, i) => {
    return(<Movie nbreLike = {oneMovie.like} nbreVue = {oneMovie.Vues} nivAvis = {oneMovie.Avis} nivMoyenne = {oneMovie.Moyenne} nameMovie = {oneMovie.Nom}/>)

  });

return (
    <Container className= "App">
       <Row>
        <Col>
        <Nav>
        <NavItem>
          <NavLink >< img src="../img/logo.png" /></NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Link</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Another Link</NavLink>
        </NavItem>
        </Nav>
        </Col>
      </Row>
      <div>{movieList}</div>
      </Container>
  );
};

export default App;
